import React, { useState } from 'react';
import Dashboard from '../../features/Dashboard';
import Map from '../../features/Map/Map';

const MainPage = () => {
    const [loading, setLoading] = useState(false);
    return (
      <div className="main-page">
        <Dashboard />
        <Map />
      </div>
    );
};

export default MainPage;
